import React from "react";
import Data from "../../Data";
const Slider = () => {
  return (
    <div>
      {Data.map((a, b) => {
        return (
          <>
            <h1>{a.name}</h1>
            <h1>{a.class}</h1>
            <h1>{a.sdfd}</h1>
          </>
        );
      })}
    </div>
  );
};

export default Slider;
